import React, { Component } from "react";
import { Route } from "react-router-dom";
import axiosWithAuth from "../utils/axiosWithAuth";
import axios from "axios";
import { Link } from "react-router-dom";

export default class GuidrTrips extends Component {
  constructor() {
    super();
    this.state = {
      guidr: []
    };
  }

  fetchData = () => {
    const data = axiosWithAuth()
      .get("http://localhost:5000/api/data")
      .then(res => {
        return res.data;
      })
      .catch(err => {
        console.log(err);
      });
    this.setState({ guidr: data.data });
  };

  componentDidMount() {
    this.fetchData();
  }

  render() {
    return (
      <div>
        <h1>My Guidr Trips</h1>
        <div>
          {this.state.guidr &&
            this.state.guidr.map(item => <p>{item.trip_name}</p>)}
        </div>
      </div>
    );
  }
}
